import React from 'react';

import classes from './Logo.module.css';

import lightBlueLogo from '../../../assets/Header/lightBlue.png';
import whiteLogo from '../../../assets/Header/white.png';

const Logo = (props) => {

    let colorClass = [classes.Logo];
    let logo = null;

    switch (props.color) {
        case "lightBlue":
            <img src={lightBlueLogo} alt="BookyBook"/>
            break;
        case "white":
            <img src={whiteLogo} alt="BookyBook"/>
            break;
        default:
            <img src={lightBlueLogo} alt="BookyBook"/>
            break;    
    }

    return (
        <img src={logo} className={colorClass.join(' ')} alt="BookyBook"/>
    );

};

export default Logo;
